import Loader from "react-loader-spinner";
import "react-loader-spinner/dist/loader/css/react-spinner-loader.css";
const CLoader = () => {
  //other logic
  return (
    <div className="Jerin">
      <Loader
        type="ThreeDots"
        color="#00BFFF"
        height={100}
        width={100}
        style={{backgroundColor:"white"}}
      />
    </div>
  );
}

export default CLoader
